import React from 'react';
import PdfDropZone from '../PdfDropZone/pdfDropZone';

const Main = () => {
    return (
        <div className="min-h-1/2screen flex flex-col justify-center items-center">
            <h1 className="text-center text-4xl font-bold mb-8">
                LETTURA SCRITTURA DATI PDF
            </h1>
            <PdfDropZone />
        </div>
    )
}

export default Main;
